syntax = "proto3";

package spiderrock.protobuf;
option csharp_namespace = "SRProtobufCore";

message DateKey {
    int32 year = 1;
    int32 month = 2;
    int32 day = 3;
}

message TickerKey {
    AssetType asset_type = 1;
    TickerSrc ticker_src = 2;
    string ticker = 3;
}

message ExpiryKey {
    AssetType asset_type = 1;
    TickerSrc ticker_src = 2;
    string ticker = 3;
    DateKey expiration = 4;
}

message OptionKey {
    AssetType asset_type = 1;
    TickerSrc ticker_src = 2;
    string ticker = 3;
    DateKey expiration = 4;
    double strike = 5;
    CallPut call_put = 6;
}

message MbusInfo {
    string message_type = 1;
    bool is_deleted = 2;
    int64 time_sent = 3;
    int32 sender_id = 4;
    SysEnvironment sys_environment0 = 5;
    SysRealm sys_realm0 = 6;
    SysEnvironment sys_environment1 = 7;
    SysRealm sys_realm1 = 8;
    SysEnvironment sys_environment2 = 9;
    SysRealm sys_realm2 = 10;
    bool from_bridge = 11;
    bool from_cache = 12;
}

